import React from 'react'
import './modules.css'

const card = (title,desc) => {
  return (
    <div class="card">
      <h3>{title}</h3>
      <p>{desc}</p>
    </div>
  )
}

const Projects = () => {
  return (
    <div className='xxa__proj' id='projects'>
            <div className='item'>
                    <a>Features</a>
                  <div className='item-about'>

                  {card('some title','some desc')}
                  
                
                  </div>
            </div>

    </div>
  )
}

export default Projects
